(6381, 'Invoice Item Updated [ID: 139, - Đ&egrave;n Led thẳng trang tr&iacute; 2 mặt 14W.<br>- Điều khiển bằng cảm ứng 4 cấp độ.<br>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi.<br>- Hút lọc khử mùi bằng than Carbon và ống thoát Ф150.]', '2017-11-07 12:24:09', 'Nguyễn Thị Ánh Hoa'),
(6382, 'Invoice Item Updated [ID: 144, - Th&acirc;n vỏ, bề mặt m&aacute;y bằng Inox 304 kết hợp k&iacute;nh đen.<br>- Điều khiển cảm ứng với màn hình hiển thị màu đa điểm TFT.<br>- 10 chương trình rửa, 6 mức nhiệt độ, dung tích 14 bộ chén dĩa.<br>- Chức năng chọn và điều chỉnh chương trình rửa ngăn trên hoặc dưới.<br>- Chức năng hẹn giờ rửa, tự động tắt máy khi hoàn tất chương trình rửa.<br>- Chức năng sấy nhanh, sấy êm.<br>- Chức năng tự động vệ sinh máy bằng tia nước diệt vi khuẩn bằng Ozone.<span> </span><br>- Chức năng tự động mở cửa thoát hơi nước làm khô nhanh chén bát, tiết kiệm 20% điện năng.<span> </span><br>- Chức năng chọn chương trình rửa tiết kiệm nước và điện năng.<br>- Chức năng báo nồng độ muối và nước làm bóng chén bát.<br>- Chức năng lọc, thu hồi nước cho lần rửa cuối, tiết kiệm 5,5 lít nước.<br>- Chức năng khóa an toàn trẻ em.]', '2017-11-07 12:28:57', 'Nguyễn Thị Ánh Hoa'),
