(6597, 'Invoice Item Updated [ID: 143, - Điều khiển chọn chức năng bằng cảm ứng.<br>- 3 chức năng chọn cà phê: Cappuccino, Espresso, Latte.<br>- Ngăn chứa cà phê 400gr. Ngăn chứa nước 2,5 lít.<br>- 6 mức cài đặt chọn lượng cà phê mong muốn.<br>- Chọn 1 tách hoặc 2 tách.<br>- Chức năng sử dụng nước sôi.<br>- Sensor kiểm soát chống tràn.<br>- Tự động làm sạch, thông đường ống bằng tia nước nóng.<br>- Xếp hạng hiệu quả năng lượng A++]', '2017-11-07 16:24:11', 'Nguyễn Thị Ánh Hoa'),
(6598, 'Invoice Item Updated [ID: 146, - Nhiệt độ giữ n&oacute;ng từ 40 đến 70&ordm;C.<br>- Chức năng nấu nhẹ ở nhiệt độ 70ºC.<br>- Chức năng đối lưu tuần hoàn gió.<br>- Chức năng hẹn giờ.]', '2017-11-07 16:24:59', 'Nguyễn Thị Ánh Hoa'),
(6599, 'Invoice Item Updated [ID: 148, - Điều khiển cảm ứng m&agrave;n h&igrave;nh hiển thị Led.<br>- Khoang chứa Inox 304.<br>- Mặt kính 2 lớp chống tia UV.<br>- Nhiệt độ cài đặt từ 5 đến 22ºC.<br>- Hệ thống làm lạnh kép, kết hợp tuần hoàn đối lưu.<br>- Hệ thống chống rung lắc.<br>- Ngăn chứa bằng gỗ sồi vàng.]', '2017-11-07 16:25:38', 'Nguyễn Thị Ánh Hoa'),
