(7903, 'Invoice Item Updated [ID: 133, - L&ograve; nướng điện đa chức năng Dudoff London kiểu &acirc;m tủ bếp<br>- Điều khiển núm xoay đa chiều, với màn hình hiển thị màu đa điểm TFT 4.3 inch.<span> </span><br>- Dung tích: 65 lít, 10 chức năng nướng cơ bản và các chức năng an toàn sử dụng.<span> </span><br>- 150 công thức nấu lập trình sẵn.<br>- Cài đặt ưu tiên 10 công thức nấu yêu thích.<br>- Chọn và cài đặt đa ngôn ngữ.<br>- Mặt kính đen 2 lớp cách nhiệt, chống bức xạ nhiệt kết hợp viền Inox.<span> </span><br>- 5 cấp độ điều chỉnh ánh sáng màn hình.<br>- 3 cấp độ cài đặt chuông báo.\r\n<div class=\"product-short-description\"></div>]', '2017-11-09 17:00:21', 'Nguyễn Ngọc Vân'),
