(7932, 'Invoice Item Updated [ID: 142, <span xss=removed>- Máy hút mùi trang trí Downdraft âm bàn bếp mặt thẳng Inox 304</span><br><span xss=removed>- Điều khiển bằng điện tử 4 cấp độ</span><br><span xss=removed>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi</span><br><span xss=removed>- Hút lọc khử mùi bằng than Carbon và ống thoát Ф150</span><br><span xss=removed>- Chức năng hẹn giờ tắt máy.</span>]', '2017-11-09 17:26:25', 'Nguyễn Ngọc Vân'),
(7933, 'Invoice Item Updated [ID: 143, <span xss=removed>- Máy pha cà phê sử dụng cà phê hạt. Thương hiệu Dudoff London. </span><br><span xss=removed>- Bề mặt Inox 304 mác thép đặc biệt, không in dấu vân tay.</span><br><span xss=removed>- Điều khiển chọn chức năng bằng cảm ứng.</span><br><span xss=removed>- 3 chức năng chọn cà phê: Cappuccino, Espresso, Latte.</span><br><span xss=removed>- Ngăn chứa cà phê 400gr. Ngăn chứa nước 2,5 lít.</span><br><span xss=removed>- 6 mức cài đặt chọn lượng cà phê mong muốn.</span><br><span xss=removed>- Chọn 1 tách hoặc 2 tách.</span><br><span xss=removed>- Chức năng sử dụng nước sôi.</span><br><span xss=removed>- Sensor kiểm soát chống tràn.</span><br><span xss=removed>- Tự động làm sạch, thông đường ống bằng tia nước nóng.</span>]', '2017-11-09 17:28:06', 'Nguyễn Ngọc Vân'),
(7934, 'Invoice Item Updated [ID: 144, <span xss=removed>- Máy rửa chén Dudoff London kiểu đứng độc lập, có thể lắp âm tủ. </span><br><span xss=removed>- Thân vỏ, bề mặt máy bằng Inox 304 kết hợp kính đen.</span><br><span xss=removed>- Điều khiển cảm ứng với màn hình hiển thị màu đa điểm TFT.</span><br><span xss=removed>- 10 chương trình rửa, 6 mức nhiệt độ, dung tích 14 bộ chén dĩa.</span><br><span xss=removed>- Chức năng chọn và điều chỉnh chương trình rửa ngăn trên hoặc dưới.</span><br><span xss=removed>- Chức năng hẹn giờ rửa, tự động tắt máy khi hoàn tất chương trình rửa.</span><br><span xss=removed>- Chức năng sấy nhanh, sấy êm.</span><br><span xss=removed>- Chức năng tự động vệ sinh máy bằng tia nước diệt vi khuẩn bằng Ozone. </span><br><span xss=removed>- Chức năng tự động mở cửa thoát hơi nước làm khô nhanh chén bát, tiết kiệm 20% điện năng. </span><br><span xss=removed>- Chức năng chọn chương trình rửa tiết kiệm nước và điện năng.</span><br><span xss=removed>- Chức năng báo nồng độ muối và nước làm bóng chén bát.</span><br><span xss=removed>- Chức năng lọc, thu hồi nước cho lần rửa cuối, tiết kiệm 5,5 lít nước.</span><br><span xss=removed>- Chức năng khóa an toàn trẻ em.</span>]', '2017-11-09 17:29:10', 'Nguyễn Ngọc Vân'),
(7935, 'Invoice Item Updated [ID: 145, <span xss=removed>- Máy rửa chén Dudoff London kiểu lắp âm tủ. </span><br><span xss=removed>- Thân vỏ bằng Inox 304, mặt trước ốp gỗ tự chọn theo phong cách riêng.</span><br><span xss=removed>- Điều khiển lập trình kỹ thuật số, hiển thị Led điện tử.</span><br><span xss=removed>- 08 chương trình rửa, 6 mức nhiệt độ, dung tích 12 bộ chén dĩa.</span><br><span xss=removed>- Chức năng chọn và điều chỉnh chương trình rửa ngăn trên hoặc dưới.</span><br><span xss=removed>- Chức năng hẹn giờ rửa, tự động tắt máy khi hoàn tất chương trình rửa.</span><br><span xss=removed>- Chức năng sấy nhanh, sấy êm.</span><br><span xss=removed>- Chức năng tự động vệ sinh máy bằng tia nước diệt vi khuẩn bằng Ozone.</span><br><span xss=removed>- Chức năng tự động mở cửa thoát hơi nước làm khô nhanh chén bát, tiết kiệm 20% điện năng. </span><br><span xss=removed>- Chức năng chọn chương trình rửa tiết kiệm nước và điện năng.</span><br><span xss=removed>- Chức năng báo nồng độ muối và nước làm bóng chén bát.</span><br><span xss=removed>- Chức năng cảnh báo, bảo vệ hệ thống làm nóng nước.</span><br><span xss=removed>- Chức năng khóa an toàn trẻ em.</span>]', '2017-11-09 17:30:15', 'Nguyễn Ngọc Vân'),
(7936, 'Invoice Item Updated [ID: 146, <span xss=removed>- Lắp đặt đồng bộ theo lò nướng để bảo quản hương vị, dưỡng chất thức ăn.</span><br><span xss=removed>- Inox 304 mác thép đặc biệt, không in dấu vân tay. </span><br><span xss=removed>- Nhiệt độ giữ nóng từ 40 đến 70ºC.</span><br><span xss=removed>- Chức năng nấu nhẹ ở nhiệt độ 70ºC.</span><br><span xss=removed>- Chức năng đối lưu tuần hoàn gió.</span><br><span xss=removed>- Chức năng hẹn giờ.</span>]', '2017-11-09 17:32:02', 'Nguyễn Ngọc Vân'),
(7937, 'Invoice Item Updated [ID: 147, <span xss=removed>- Lắp đặt đồng bộ theo tủ rượu để chứa dụng cụ thao tác rượu.</span><br><span xss=removed>- Inox 304 mác thép đặc biệt, không in dấu vân tay.</span><br><span xss=removed>- Ngăn chứa dụng cụ bằng gỗ sồi vàng.</span>]', '2017-11-09 17:34:01', 'Nguyễn Ngọc Vân'),
(7938, 'Invoice Item Updated [ID: 148, <span xss=removed>- Tủ bảo quản rượu. Thương hiệu Dudoff London.</span><br><span xss=removed>- Bề mặt kính màu, phối hợp Inox 304 mác thép đặc biệt, không in dấu vân tay.</span><br><span xss=removed>- Điều khiển cảm ứng màn hình hiển thị Led.</span><br><span xss=removed>- Khoang chứa Inox 304.</span><br><span xss=removed>- Mặt kính 2 lớp chống tia UV.</span><br><span xss=removed>- Nhiệt độ cài đặt từ 5 đến 22ºC.</span><br><span xss=removed>- Hệ thống làm lạnh kép, kết hợp tuần hoàn đối lưu.</span><br><span xss=removed>- Hệ thống chống rung lắc.</span><br><span xss=removed>- Ngăn chứa bằng gỗ sồi vàng.</span><br><span xss=removed>- Dung tích chứa 24 chai O76.</span>]', '2017-11-09 17:36:57', 'Nguyễn Ngọc Vân'),
(7939, 'Invoice Item Updated [ID: 144, <span xss=\"removed\" xss=removed>- Máy rửa chén Dudoff London kiểu đứng độc lập, có thể lắp âm tủ. </span><br><span xss=\"removed\" xss=removed>- Thân vỏ, bề mặt máy bằng Inox 304 kết hợp kính đen.</span><br><span xss=\"removed\" xss=removed>- Điều khiển cảm ứng với màn hình hiển thị màu đa điểm TFT.</span><br><span xss=\"removed\" xss=removed>- 10 chương trình rửa, 6 mức nhiệt độ, dung tích 14 bộ chén dĩa.</span><br><span xss=\"removed\" xss=removed>- Chức năng chọn và điều chỉnh chương trình rửa ngăn trên hoặc dưới.</span><br><span xss=\"removed\" xss=removed>- Chức năng hẹn giờ rửa, tự động tắt máy khi hoàn tất chương trình rửa.</span><br><span xss=\"removed\" xss=removed>- Chức năng sấy nhanh, sấy êm.</span><br><span xss=\"removed\" xss=removed>- Chức năng tự động vệ sinh máy bằng tia nước diệt vi khuẩn bằng Ozone. </span><br><span xss=\"removed\" xss=removed>- Chức năng tự động mở cửa thoát hơi nước làm khô nhanh chén bát, tiết kiệm 20% điện năng. </span><br><span xss=\"removed\" xss=removed>- Chức năng chọn chương trình rửa tiết kiệm nước và điện năng.</span><br><span xss=\"removed\" xss=removed>- Chức năng báo nồng độ muối và nước làm bóng chén bát.</span><br><span xss=\"removed\" xss=removed>- Chức năng lọc, thu hồi nước cho lần rửa cuối, tiết kiệm 5,5 lít nước.</span><br><span xss=\"removed\" xss=removed>- Chức năng khóa an toàn trẻ em.</span>]', '2017-11-09 17:39:20', 'Nguyễn Ngọc Vân'),
(7940, 'Invoice Item Updated [ID: 145, <span xss=\"removed\" xss=removed>- Máy rửa chén Dudoff London kiểu lắp âm tủ. </span><br><span xss=\"removed\" xss=removed>- Thân vỏ bằng Inox 304, mặt trước ốp gỗ tự chọn theo phong cách riêng.</span><br><span xss=\"removed\" xss=removed>- Điều khiển lập trình kỹ thuật số, hiển thị Led điện tử.</span><br><span xss=\"removed\" xss=removed>- 08 chương trình rửa, 6 mức nhiệt độ, dung tích 12 bộ chén dĩa.</span><br><span xss=\"removed\" xss=removed>- Chức năng chọn và điều chỉnh chương trình rửa ngăn trên hoặc dưới.</span><br><span xss=\"removed\" xss=removed>- Chức năng hẹn giờ rửa, tự động tắt máy khi hoàn tất chương trình rửa.</span><br><span xss=\"removed\" xss=removed>- Chức năng sấy nhanh, sấy êm.</span><br><span xss=\"removed\" xss=removed>- Chức năng tự động vệ sinh máy bằng tia nước diệt vi khuẩn bằng Ozone.</span><br><span xss=\"removed\" xss=removed>- Chức năng tự động mở cửa thoát hơi nước làm khô nhanh chén bát, tiết kiệm 20% điện năng. </span><br><span xss=\"removed\" xss=removed>- Chức năng chọn chương trình rửa tiết kiệm nước và điện năng.</span><br><span xss=\"removed\" xss=removed>- Chức năng báo nồng độ muối và nước làm bóng chén bát.</span><br><span xss=\"removed\" xss=removed>- Chức năng cảnh báo, bảo vệ hệ thống làm nóng nước.</span><br><span xss=\"removed\" xss=removed>- Chức năng khóa an toàn trẻ em.</span>]', '2017-11-09 17:40:15', 'Nguyễn Ngọc Vân');
