(8346, 'Invoice Item Updated [ID: 208, <span>- Chậu rửa chén kiểu 2 hộc lắp sát trên mặt đá</span><br><span>- Chế tạo bán thủ công</span><br><span>- Vật liệu: Inox 304 18/10 dày 1.0mm, bề mặt line mờ</span>]', '2017-11-10 09:30:45', 'Nguyễn Ngọc Vân'),
(8347, 'Invoice Item Updated [ID: 209, - L&ograve; hấp hơi nước, kết hợp nấu, nướng<br>- Bề mặt kính màu, phối hợp Inox 304, đặc biệt không in dấu vân tay<br>- Chức năng nấu tự chọn theo thời gian, nhiệt độ và trọng lượng.<span> </span><br>- Chức năng nấu, kết hợp nướng thông gió tuần hoàn<br>- Chức năng tự động làm sạch lò bằng tia nước nóng.<span> </span><br>- Chức năng khóa an toàn.<br>- Điều khiển cảm ứng đa chức năng, màn hình màu đa điểm<br>- Khoang nấu Inox 304.<span> </span><br>- Hấp bằng hơi nước với nhiệt độ từ 100 đến 230ºC<br>- 12 chức năng nấu tự động lập trình sẵn]', '2017-11-10 09:31:43', 'Nguyễn Ngọc Vân'),
(8348, 'Invoice Item Updated [ID: 215, - M&aacute;y h&uacute;t m&ugrave;i đảo trang tr&iacute; dạng ống kh&oacute;i bề mặt cong, Inox 304.<br>- Đèn Led dạng thanh 2x8W, kết hợp Led màu trang trí xung quanh mặt máy.<span> </span><br>- Điều khiển bằng điện tử 3 cấp độ.<br>- Chức năng hút nhanh cấp tốc 10 phút.<br>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi.<span> </span><br>- Hút lọc khử mùi bằng than Carbon và ống thoát Ф150.<br>- Chức năng hẹn giờ tắt máy.]', '2017-11-10 09:33:14', 'Nguyễn Ngọc Vân'),
(8349, 'Invoice Item Updated [ID: 217, <span>- Máy hút mùi đảo trang trí treo cáp, hình cầu, chế tạo bán thủ công từ nhựa Plastic ABS kết hợp Inox 304. <br>- Tự động điều chỉnh lên xuống chọn độ cao theo ý muốn.<br>- Đèn Laser quét đa chiều, tự động thay đổi 7 màu sắc.<br>- Chức năng chọn màu sắc đèn theo sở thích.<br>- Chức năng chọn kiểu hiển thị cho màu sắc đèn, hiển thị 1 màu cố định hay tự động quét nhiều màu.<br>- Chức năng cài đặt thời gian quét đổi màu đèn.<br>- Đèn Led hội tụ tia trang trí dưới mặt máy 4x1W.<br>- Điều khiển bằng Remote, 3 cấp độ hút.<br>- Chức năng hút nhanh cấp tốc.<br>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi.<br>- Hút lọc tuần hoàn, khử mùi bằng than Carbon. <br>- Chức năng hẹn giờ tắt máy.<br></span>]', '2017-11-10 09:34:46', 'Nguyễn Ngọc Vân'),
