(9030, 'Invoice Item Updated [ID: 217, <span>- Máy hút mùi đảo trang trí treo cáp, hình cầu, chế tạo bán thủ công từ nhựa Plastic ABS kết hợp Inox 304. <br>- Tự động điều chỉnh lên xuống chọn độ cao theo ý muốn.<br>- Đèn Laser quét đa chiều, tự động thay đổi 7 màu sắc.<br>- Chức năng chọn màu sắc đèn theo sở thích.<br>- Chức năng chọn kiểu hiển thị cho màu sắc đèn, hiển thị 1 màu cố định hay tự động quét nhiều màu.<br>- Chức năng cài đặt thời gian quét đổi màu đèn.<br>- Đèn Led hội tụ tia trang trí dưới mặt máy 4x1W.<br>- Điều khiển bằng Remote, 3 cấp độ hút.<br>- Chức năng hút nhanh cấp tốc.<br>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi.<br>- Hút lọc tuần hoàn, khử mùi bằng than Carbon. <br>- Chức năng hẹn giờ tắt máy.<br></span>]', '2017-11-14 17:26:08', 'Nguyễn Ngọc Vân'),
