(9113, 'Invoice Item Updated [ID: 133, - L&ograve; nướng điện đa chức năng Dudoff London kiểu &acirc;m tủ bếp<br>- Điều khiển núm xoay đa chiều, với màn hình hiển thị màu đa điểm TFT 4.3 inch.<span> </span><br>- 10 chức năng nướng cơ bản và các chức năng an toàn sử dụng.<span> </span><br>- 150 công thức nấu lập trình sẵn.<br>- Cài đặt ưu tiên 10 công thức nấu yêu thích.<br>- Chọn và cài đặt đa ngôn ngữ.<br>- Mặt kính đen 2 lớp cách nhiệt, chống bức xạ nhiệt kết hợp viền Inox.<span> </span><br>- 5 cấp độ điều chỉnh ánh sáng màn hình.<br>- 3 cấp độ cài đặt chuông báo.\r\n<div class=\"product-short-description\"></div>]', '2017-11-14 19:14:21', 'Nguyễn Ngọc Vân'),
(9114, 'Invoice Item Updated [ID: 134, <span xss=\"removed\">- Lò nướng đa chức năng kết hợp nấu. Thương hiệu Dudoff London </span><br><span xss=\"removed\">- Bề mặt kính màu, phối hợp Inox 304 mác thép đặc biệt, không in dấu vân tay</span><br><span xss=\"removed\">- Điều khiển cảm ứng đa chức năng, màn hình màu đa điểm</span><br><span xss=\"removed\">- Kính an toàn 3 lớp cách nhiệt, chống bức xạ nhiệt</span><br><span xss=\"removed\">- Khoang nướng Inox 304 </span><br><span xss=\"removed\">- 14 chức năng nướng chuyên dùng</span><br><span xss=\"removed\">- Chức năng nướng đối lưu tuần hoàn nhiệt</span><br><span xss=\"removed\">- Chức năng lập trình nấu tự động</span><br><span xss=\"removed\">- Chức năng tự động làm sạch lò bằng tia nước nóng </span><br><span xss=\"removed\">- Chức năng khóa an toàn.</span>]', '2017-11-14 19:16:25', 'Nguyễn Ngọc Vân'),
