(133, '', 'P00132', 'Lò nướng đa chức năng hiệu DuDoff London, mã số PEARL (OE-V02RC)', 'PEARL (OE-V02RC)', '- L&ograve; nướng điện đa chức năng Dudoff London kiểu &acirc;m tủ bếp<br>- Điều khiển núm xoay đa chiều, với màn hình hiển thị màu đa điểm TFT 4.3 inch.<span> </span><br>- 10 chức năng nướng cơ bản và các chức năng an toàn sử dụng.<span> </span><br>- 150 công thức nấu lập trình sẵn.<br>- Cài đặt ưu tiên 10 công thức nấu yêu thích.<br>- Chọn và cài đặt đa ngôn ngữ.<br>- Mặt kính đen 2 lớp cách nhiệt, chống bức xạ nhiệt kết hợp viền Inox.<span> </span><br>- 5 cấp độ điều chỉnh ánh sáng màn hình.<br>- 3 cấp độ cài đặt chuông báo.\r\n<div class=\"product-short-description\"></div>', '<img src=\"http://foso.info/01917F/media/PEARL.jpg\" alt=\"\" width=\"637\" height=\"488\">', NULL, NULL, NULL, '5.00', 1, '4', 4, '0000-00-00', '0000-00-00', 228, '12*12', '(Dài x rộng x sâu) 595 x 595 x 575mm', '0.5', '-&nbsp;Dung t&iacute;ch: 65 l&iacute;t<br>- Tổng công suất 3,1KW, điện áp 220V – 50Hz<br>- Xếp hạng hiệu quả năng lượng: A++<br>- Kích thước: ( Dài x rộng x sâu) 595 x 595 x 575mm<br>- Kích thước lắp đặt: ( Dài x rộng x sâu) 590 x 560 x 555mm<br>- Bảo hành 5 năm theo tiêu chuẩn của Dudoff London toàn cầu<br>- Sản xuất tại Châu Âu.', 29900000, 0, 29900000, 'uploads/client_profile_images/133/PEARL_PIC.jpg', 10, 50, 0, '6', 433, '12', '0.00', 0, '', 'uploads/client_profile_images/133/PEARL_KT.jpg'),
