(143, '', 'P00143', 'Máy pha cà phê hiệu DuDoff London, mã số KOPI 45S', 'KOPI 45S', '<span xss=removed>- Máy pha cà phê sử dụng cà phê hạt. Thương hiệu Dudoff London. </span><br><span xss=removed>- Bề mặt Inox 304 mác thép đặc biệt, không in dấu vân tay.</span><br><span xss=removed>- Điều khiển chọn chức năng bằng cảm ứng.</span><br><span xss=removed>- 3 chức năng chọn cà phê: Cappuccino, Espresso, Latte.</span><br><span xss=removed>- Ngăn chứa cà phê 400gr. Ngăn chứa nước 2,5 lít.</span><br><span xss=removed>- 6 mức cài đặt chọn lượng cà phê mong muốn.</span><br><span xss=removed>- Chọn 1 tách hoặc 2 tách.</span><br><span xss=removed>- Chức năng sử dụng nước sôi.</span><br><span xss=removed>- Sensor kiểm soát chống tràn.</span><br><span xss=removed>- Tự động làm sạch, thông đường ống bằng tia nước nóng.</span>', '<img src=\"http://foso.info/01917F/media/KOPI 45S.jpg\" alt=\"\" width=\"655\" height=\"654\">', NULL, NULL, NULL, '10.00', 3, '4', 3, '2017-01-01', '2017-11-30', 109, '', '594 x 455 x 533mm', '', '<div class=\"product-short-description\">\r\n<div class=\"product-short-description\"><span xss=removed>- Kích thước (dài, rộng, sâu): 594 x 455 x 533mm</span><br><span xss=removed>- Kích thước lắp đặt.(dài, rộng, sâu): 560 x 450 x 560mm</span><br><span xss=removed>- Xếp hạng hiệu quả năng lượng A++</span><br><span xss=removed>- Bảo hành 5 năm theo tiêu chuẩn của Dudoff London toàn cầu</span><br><span xss=removed>- Sản xuất tại Ý.</span></div>\r\n</div>', 48870000, 0, 48870000, 'uploads/client_profile_images/143/KOPI-45S.jpg', 10, 50, 0, '12', 440, '60', '0.00', 0, NULL, NULL),
(144, '', 'P00144', 'Máy rửa chén hiệu DuDoff London đứng độc lập, mã số VENUS-DV01 (DW-V01FT)', 'VENUS-DV01', '<span xss=\"removed\" xss=removed>- Máy rửa chén Dudoff London kiểu đứng độc lập, có thể lắp âm tủ. </span><br><span xss=\"removed\" xss=removed>- Thân vỏ, bề mặt máy bằng Inox 304 kết hợp kính đen.</span><br><span xss=\"removed\" xss=removed>- Điều khiển cảm ứng với màn hình hiển thị màu đa điểm TFT.</span><br><span xss=\"removed\" xss=removed>- 10 chương trình rửa, 6 mức nhiệt độ, dung tích 14 bộ chén dĩa.</span><br><span xss=\"removed\" xss=removed>- Chức năng chọn và điều chỉnh chương trình rửa ngăn trên hoặc dưới.</span><br><span xss=\"removed\" xss=removed>- Chức năng hẹn giờ rửa, tự động tắt máy khi hoàn tất chương trình rửa.</span><br><span xss=\"removed\" xss=removed>- Chức năng sấy nhanh, sấy êm.</span><br><span xss=\"removed\" xss=removed>- Chức năng tự động vệ sinh máy bằng tia nước diệt vi khuẩn bằng Ozone. </span><br><span xss=\"removed\" xss=removed>- Chức năng tự động mở cửa thoát hơi nước làm khô nhanh chén bát, tiết kiệm 20% điện năng. </span><br><span xss=\"removed\" xss=removed>- Chức năng chọn chương trình rửa tiết kiệm nước và điện năng.</span><br><span xss=\"removed\" xss=removed>- Chức năng báo nồng độ muối và nước làm bóng chén bát.</span><br><span xss=\"removed\" xss=removed>- Chức năng lọc, thu hồi nước cho lần rửa cuối, tiết kiệm 5,5 lít nước.</span><br><span xss=\"removed\" xss=removed>- Chức năng khóa an toàn trẻ em.</span>', '', NULL, NULL, NULL, '10.00', 3, '4', 3, '2017-01-01', '2017-11-30', 228, '', 'W600 x D600 x H850mm.', '', '<div class=\"product-short-description\"><span xss=\"removed\" xss=removed>- Độ ồn siêu nhỏ : < 44dBA></span><br><span xss=\"removed\" xss=removed>- Tổng công suất: 1900W.</span><br><span xss=\"removed\" xss=removed>- Xếp hạng năng lượng: A+++.</span><br><span xss=\"removed\" xss=removed>- Điện thế: 220~240V/50Hz.</span><br><span xss=\"removed\" xss=removed>- Kích thước: W600 x D600 x H850mm.</span><br><span xss=\"removed\" xss=removed>- Bảo hành 5 năm theo tiêu chuẩn của Dudoff London toàn cầu</span><br><span xss=\"removed\" xss=removed>- Sản xuất tại Châu Âu.</span></div>', 35850000, 0, 35850000, 'uploads/client_profile_images/144/VENUS-DV01.jpg', 10, 50, 0, '12', 422, '60', '0.00', 0, NULL, NULL),
