(209, '', 'SP-00209', 'Lò hấp kết hợp nướng hiệu DuDoff London, mã số SPRING 45S', 'SPRING 45S', '- L&ograve; hấp hơi nước, kết hợp nấu, nướng<br>- Bề mặt kính màu, phối hợp Inox 304, đặc biệt không in dấu vân tay<br>- Chức năng nấu tự chọn theo thời gian, nhiệt độ và trọng lượng.<span> </span><br>- Chức năng nấu, kết hợp nướng thông gió tuần hoàn<br>- Chức năng tự động làm sạch lò bằng tia nước nóng.<span> </span><br>- Chức năng khóa an toàn.<br>- Điều khiển cảm ứng đa chức năng, màn hình màu đa điểm<br>- Khoang nấu Inox 304.<span> </span><br>- Hấp bằng hơi nước với nhiệt độ từ 100 đến 230ºC<br>- 12 chức năng nấu tự động lập trình sẵn', '', NULL, NULL, NULL, '10.00', 3, '4', 3, '2017-01-01', '2017-11-30', 109, '', '(dài, rộng, sâu) 594 x 455 x 533mm', '', '<div class=\"product-short-description\">- Dung tích 34 lít<br>- Tổng công suất 2800W, điện áp 220 – 230v, 50Hz<br>- Kích thước (dài, rộng, sâu): 594 x 455 x 533mm<br>- Kích thước lắp đặt (dài, rộng, sâu): 560 x 458 x 560mm<br>- Bảo hành 5 năm theo tiêu chuẩn của Dudoff London toàn cầu<br>- Sản xuất tại Ý</div>', 48870000, 0, 48870000, 'uploads/client_profile_images/209/SPRING-45S.jpg', 10, 50, 0, '12', 437, '60', '0.00', 0, NULL, NULL),
