(215, '', 'SP-00215', 'Máy hút khử mùi đảo hiệu DuDoff London kiểu ống khói, mã số ARCADIA ISOLA 90SG', 'ARCADIA ISOLA 90SG', '- M&aacute;y h&uacute;t m&ugrave;i đảo trang tr&iacute; dạng ống kh&oacute;i bề mặt cong, Inox 304.<br>- Đèn Led dạng thanh 2x8W, kết hợp Led màu trang trí xung quanh mặt máy.<span> </span><br>- Điều khiển bằng điện tử 3 cấp độ.<br>- Chức năng hút nhanh cấp tốc 10 phút.<br>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi.<span> </span><br>- Hút lọc khử mùi bằng than Carbon và ống thoát Ф150.<br>- Chức năng hẹn giờ tắt máy.', '', NULL, NULL, NULL, '10.00', 3, '4', 4, '2017-01-01', '2017-11-30', 109, '', 'W900 x D600 x H1060mm', '', '<div class=\"product-short-description\">\r\n<div class=\"product-short-description\">- Công suất 275W.<span> </span><br>- Lưu lượng 900m⊃3;/h, độ ồn < 57dB>- Kích thước W900 x D600 x H1060mm.<span> </span><br>- Màu sắc: Inox mờ.<br>- Xếp hạng năng lượng siêu tiết kiệm.<span> </span><br>- Bảo hành 5 năm theo tiêu chuẩn của Dudoff London toàn cầu.<br>- Sản xuất tại Ý</div>\r\n</div>', 44890000, 0, 44890000, 'uploads/client_profile_images/215/Arcadia-Isola-90SS.jpg', 5, 20, 0, '12', 390, '60', '0.00', 0, NULL, NULL),
