(217, '', 'SP-00217', 'Máy hút khử mùi đảo hiệu DuDoff London kiểu treo cáp dạng hình cầu, mã số HERMES', 'HERMES', '<span>- Máy hút mùi đảo trang trí treo cáp, hình cầu, chế tạo bán thủ công từ nhựa Plastic ABS kết hợp Inox 304. <br>- Tự động điều chỉnh lên xuống chọn độ cao theo ý muốn.<br>- Đèn Laser quét đa chiều, tự động thay đổi 7 màu sắc.<br>- Chức năng chọn màu sắc đèn theo sở thích.<br>- Chức năng chọn kiểu hiển thị cho màu sắc đèn, hiển thị 1 màu cố định hay tự động quét nhiều màu.<br>- Chức năng cài đặt thời gian quét đổi màu đèn.<br>- Đèn Led hội tụ tia trang trí dưới mặt máy 4x1W.<br>- Điều khiển bằng Remote, 3 cấp độ hút.<br>- Chức năng hút nhanh cấp tốc.<br>- Lưới lọc dầu mỡ bằng hợp kim nhôm sợi.<br>- Hút lọc tuần hoàn, khử mùi bằng than Carbon. <br>- Chức năng hẹn giờ tắt máy.<br></span>', '', NULL, NULL, NULL, '10.00', 3, '4', 4, '0000-00-00', '0000-00-00', 109, '', 'Ф 600 x H1300mm', '', '<div class=\"product-short-description\">\r\n<div class=\"product-short-description\">- Tổng công suất 250W.<span> </span><br>- Lưu lượng 720m3/h, độ ồn < 55dB>- Kích thước Ф 600 x H1300mm.<span> </span><br>- Màu sắc trạng thái tự nhiên: Trắng sữa.<br>- Bảo hành 5 năm theo tiêu chuẩn của Dudoff London toàn cầu.<br>- Sản xuất tại Ý</div>\r\n</div>', 97600000, 0, 97600000, 'uploads/client_profile_images/217/HERMES.jpg', 5, 50, 0, '12', 390, '60', '0.00', 0, '', 'uploads/client_profile_images/217/HERMES_KT.jpg'),
